import React from 'react';
import {Link, useParams} from 'react-router-dom'
import TrainingSidebar from './TrainingSidebar';
import {useEffect, useState} from 'react'
import axios from 'axios';

const baseUrl = 'http://127.0.0.1:8000/api';

function TrainingDetails(){

    //Fetch training details
    const [trainingData, settrainingData] = useState([]);
    const teacherId = localStorage.getItem("teacherId");
    useEffect(() => {
        try {
        axios.get(baseUrl + "/training-details/"+teacherId).then((res) => {
            // console.log(res)
            settrainingData(res.data);
        });
        } catch (error) {
        console.log(error);
        }
    }, []);


    //Fetch enrolled student
    const [courseData, setCourseData] = useState([]);
    useEffect(() => {
        try {
        axios.get(baseUrl + "/teacher-course/" + '10').then((res) => {
            setCourseData(res.data);
        });
        } catch (error) {
        console.log(error);
        }
    }, []);

      //Meeting Redirection
      const RedMeeting = ()=>{
        {trainingData.map((meeting, index)=>(
          window.location.href=meeting.meeting_link
        ))
        }
    }

    return(
        <div className="container-fluid main_container mt-5">
      <div className="row">
        <aside className="col-md-3 "><TrainingSidebar /></aside>
        <div className="col-md-7">
          <div className="card">
            <h5 className="card-header">Trainer Utilization</h5>
            <div className="card-body">
              <table className="table table-bordered">
                <thead>
                  <tr className='text-center'>
                    <th>Course</th>
                    <th>Date</th>
                    <th>From</th>
                    <th>to</th>
                    <th>Attendee(s)</th>  
                    <th>Meeting Link</th>
                  </tr>
                </thead>
                <tbody className='text-center'>
                {trainingData.map((training, index) => (
                    <tr>
                        <td>
                            <Link to={`/course-detail/`+training.course.id}>{training.course.title}</Link>
                        </td>
                        <td>
                            {training.date}
                            </td>
                        <td>
                            {training.f_time}
                        </td>
                        <td>
                            {training.t_time}
                        </td>

                        <td>
                        {courseData.map((course, index) => (
                            <Link to={`/edenrolled-students/`+course.id}>{course.total_enrolled_students}</Link>
                        ))}
                        </td>
                        <td>
                            {training.meeting_link}
                        </td>
                    </tr>
                ))}    
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </div>
    </div>
    )
}

export default TrainingDetails;
